import os
import tkinter as tk
from tkinter import messagebox
from PIL import Image, ImageTk
import base64
import io

#immagine
# Immagine codificata in base64
base64_image = ""

# Decodifica l'immagine
image_bytes = base64.b64decode(base64_image)
image = Image.open(io.BytesIO(image_bytes))
#fine immagine

#finestra countdown da aprire dopo la scelta

def avvia_iberna(valore_scelto):
    def visualizza_countdown(num_of_secs):
        def update_label():
            def converti_tempo(num_of_secs):
                # Calcola i minuti e i secondi
                num_minutes, seconds = divmod(num_of_secs, 60)
                # Calcola le ore e i minuti
                num_hours, minutes = divmod(num_minutes, 60)
                # Restituisci il risultato formattato
                return f"{num_hours:02d}:{minutes:02d}:{seconds:02d}"

            nonlocal num_of_secs
            if num_of_secs > 0:
                label.config(text=f"Ibernazione tra: {converti_tempo(num_of_secs)}")
                num_of_secs -= 1
                finestra.after(1000, update_label)  # Aggiorna ogni secondo
            else:
                finestra.destroy()
                os.system("shutdown /h /f")

        finestra = tk.Tk()
        finestra.title("Countdown Ibernazione")
        finestra.geometry("350x80+800+400")
        finestra.resizable(False, False)
        finestra["bg"] = "#49a"

        label = tk.Label(finestra, bg="#49a", fg="#fff", font=("Helvetica", 20))
        label.pack(pady=20)

        update_label()

        finestra.mainloop()
    try:
        # Calcola il valore da passare al countdown
        valore_parametro = valore_scelto * 60
    #    os.system(f"start iberna {valore_parametro}")
        root.destroy()
        visualizza_countdown(valore_parametro)
    except Exception as e:
        messagebox.showerror("Errore", f"Si  verificato un errore: {str(e)}")

#fine finestra countdown da aprire dopo la scelta

#inizio finestra principale

def seleziona_valore():
    valore_scelto = var.get()
    if valore_scelto:
        avvia_iberna(valore_scelto)
    else:
        messagebox.showwarning("Attenzione", "Seleziona un valore per far partire il countdown")

# Creazione dell'interfaccia grafica
root = tk.Tk()
root.title("Iberna tra...")
root.geometry("400x400+800+280")
root.resizable(False,False)
root["bg"] = "#ffffff"


# Crea un oggetto PhotoImage dall'immagine decodificata
photo = ImageTk.PhotoImage(image)


# Crea un widget Label con l'immagine come sfondo
label = tk.Label(root, image=photo)
label.place(x=0, y=0, relwidth=1, relheight=1)  # Imposta la posizione e le dimensioni


#prosegui

tk.Label(root, text="",bg='#ffffff', fg='#000', font=("Helvetica", 4)).pack()
# Etichetta per la scala
tk.Label(root, text="...quanti minuti?",bg='#ffffff', fg='#000', font=("Helvetica", 14)).pack()

var = tk.IntVar()

# Crea i radio button per i valori
valori = [1, 5, 10, 15, 30, 60, 90, 120, 180]
for valore in valori:
    tk.Radiobutton(root, text=f"{valore}",bg='#ffffff', fg='#000', font=("Helvetica", 14), variable=var, value=valore).pack()

tk.Label(root, text="",bg='#ffffff', fg='#000', font=("Helvetica", 4)).pack()

# Bottone per avviare il countdown
tk.Button(root, text="AVVIA",bg='#ffffff', fg='#009999', font=("Helvetica", 18, "bold"), command=seleziona_valore).pack()

root.mainloop()

#fine finestra principale
